import React from 'react';

var ProgressBar = ({width, percent}) => {

    let progress = percent * width;

    return(
    <div style={{width: width}} className="progress-div">
        <div style={{width:`${progress}px`}} className="progress" />
    </div>)
};

export default ProgressBar;
